import logo from './logo.svg';
import './App.css';
import Header from './Header.js';
import Map from'./Map.js';
import Vehicles from'./Vehicles.js';


function App() {
  return (
    <div id="body">
      <Header />
      <Map />
      <Vehicles /> 
    </div>
  );
}

export default App;
